It’s truly special that we get to call this “work” 🫡 

The last nine days have been jam-packed and long. We’re tired but it’s so worth it when we get to have meaningful and open conversations with some of the best athletes in the world.

CITIUS MAG LIVE AT WORLDS was our second consecutive year of bringing fans a daily talk show each day of the World Championships. With more than 200 countries represented and 2,000+ athletes, we know it can be tough to share some athletes’ stories on a full TV broadcast. We aim to amplify and showcase those stars’ accomplishments and personalities through our interviews and hopefully that shines through for the fans.

